import axios from "axios";
import { useEffect, useState } from "react";
import "./App.css";

function App() {
  const [isList, setIsList] = useState(false);
  const [data, setData] = useState();

  const getList = () => {
    setIsList(true);
  };

  const onSubmit = (e) => {
    e.target.preventdefault();
    const obj = e.target.value[e.target.name];
    console.log(obj, "onSubmit");
    getList();
  };
  useEffect(() => {
    (async () => {
      const result = await axios("https://www.fastpeoplesearch.com/name/manuel")
        .then((res) => setData(res))
        .catch((err) => console.log(err));
    })();
    result();
  }, []);

  console.log(data);
  return (
    <div className="App">
      <header className="App-header">
        <h1>Filtro para buscar telefonos</h1>
        <form>
          <label>Telefono: </label>
          <input type="number" />
          <input type="submit" onChange={onSubmit} />
        </form>
      </header>
    </div>
  );
}

export default App;
